  `updated` datetime DEFAULT NULL,
  `is_default` tinyint(4) DEFAULT '0' COMMENT '是否默认地址 1：是 0：不是',
  PRIMARY KEY (`addr_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

